import React from 'react';
import classes from './service.module.css';
import p1 from './p.jpg';
import p2 from './r1.jpg';
import p3 from './r2.jpg';
import p4 from './r3.jpg';
import p5 from './r4.jpg';

function ServicesPage() {
  return (
    <div className={classes.container}>
      {/* First Block */}
      <div className={classes.hero}>
        <img src={p1}  className={classes.heroImage} />
        <div className={classes.heroText}>NN Engineers</div>
      </div>

      {/* Second Block - Services */}
      <div className={classes.services}>
        <h2>Our Services</h2>
        <ul>
          <li>IconPEB-PRE-Engineered Steel Building</li>
          <li>IconStructural Steel</li>
          <li>IconRooftop Installation Service</li>
          <li>IconIndustrial Structural Painting</li>
          <li>IconWarehouse Shed Fabrication Services</li>
          <li>IconFactory Shed Fabrication Services</li>
          <li>IconPipeline Fabrication Services</li>
          <li>IconChemical Anchor Installation</li>
          <li>IconHILTi Anchoring Services</li>
          <li>IconCore Cutting Services</li>
          <li>IconHILTi Firestop</li>
          <li>IconStorage Solutions</li>
          <li>IconTechnical Advisory Service</li>
        </ul>
      </div>
    </div>
  );
}

export default ServicesPage;
